import React from 'react';

class Task extends React.Component {
    render(){
        const {task} = this.props;

        return <div>
            {task.title} - {this.props.task.descripcion} - {this.props.task.done} - {this.props.task.id}
            <input type="checkbox"></input>
            <button>x</button>
        </div>
    }
}

export default Task;
